import React, { Component } from 'react'
import { Menu, MenuItem, Avatar } from '@material-ui/core';
import nature from '../nature.jpeg'


export default class MenuComponent extends Component {





    render() {
        return (
            <div>
                <div className='desktopPic'>
                            <Avatar src={nature}
                                aria-label="account of current user"
                                aria-controls="menu-appbar"
                                aria-haspopup="true"
                                onClick={this.handleMenu}
                            />
                        </div>
                 <Menu
                        id="menu-appbar"
                        anchorEl={this.props.anchorEl}
                        onClose={this.props.handleClose}
                        open={this.props.menuOpen}
                        anchorOrigin={{
                            vertical: 'top',
                            horizontal: 'right',
                        }}
                        keepMounted
                        transformOrigin={{
                          vertical: 'top',
                          horizontal: 'right',
                        }}
                        >
                        <MenuItem onClick={this.props.handleClose}>My Account</MenuItem>
                        <MenuItem onClick={this.props.logout}>Sign out</MenuItem>

                    </Menu>
            </div>
        )
    }
}
